import {Form, Button} from 'semantic-ui-react';
import Layout from '../../components/Layout';
class TrustfundNew extends Component{
  render(){
    return (
<Layout>
       <h1>New Trust fund </h1>
</Layout>
     );
  }
}
export default TrustfundNew
